import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          hello pory
        </p>
      </header>
    </div>
  );
}
function Tri({item})
{
  return(
    <Fragment>
      <dt>{item.term}</dt>
      <dt>{item.description}</dt>
    </Fragment>
  );
}

export default App;
